import React from 'react';
import RewardTableComponent from '../Components/RewardComponent';
import { Grid } from 'semantic-ui-react';

const SinglePlayerPage = () => {
    return <Grid>
        <Grid.Row centered>
            <Grid.Column width={8}>
                <RewardTableComponent/>
            </Grid.Column>
        </Grid.Row>
    </Grid>
}

export default SinglePlayerPage;
